        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Définie par l’Organisation Mondiale de la Santé comme « la prise en charge collective de la santé d’une 
                    population dans son milieu de vie, qu’il s’agisse de soins, prévention, éducation ou hygiène sociale », 
                    les études de Master en santé publique à 
                    Business Intelligence Institute of Management permettent a l’étudiant de se spécialiser dans l’un des 6 parcours proposés.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
  ");
            WriteLiteral(@"              <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    L'objectif général du master mention santé publique est de former des futurs professionnels et chercheurs 
                    dans les principaux domaines de la santé publique (épidémiologie, biostatistique, management et politiques de santé, 
                    promotion et éducation pour la santé, santé au travail, santé environnementale) capables de comprendre, 
                    d’analyser et de traiter les problèmes de santé de la population dans une approche globale et pluridisciplinaire.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    Master en Santé publique forme des professionnels de santé publique polyvalents, 
                    autonomes et capables de mener des activité");
            WriteLiteral(@"s qui concourent
                </p>
                <ul class=""one_list"">
                    <li> 
                        à la description et la surveillance de la santé au niveau de la population,
                    </li>
                    <li> 
                        à la connaissance des déterminants de la santé,
                     </li>
                    <li> 
                        à la promotion et l'éducation pour la santé,
                    </li>
                    <li> 
                        à la conception, la mise en œuvre et l’évaluation des actions de santé,
                    </li>
                    <li> 
                        à la planification et la gestion en santé publique,
                     </li>
                    <li> 
                        à la planification, la réalisation et l'interprétation des analyses statistiques en santé,
                    </li>
                    <li> 
                        à la gestion des systèmes d'inform");
            WriteLiteral(@"ation et au traitement des informations biomédicales et de santé,
                    </li>
                </ul>
                <p class=""description""> 
                    dans le but de protéger et d’améliorer l’état de santé des populations.
                </p>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    La première année du master (M1) correspond à 60 ECTS (European Credit Transfer System) et est organisée en deux semestres ; 
                    après un tronc commun de 30 ECTS couvrant la plupart des domaines de la santé publique (biostatistique, épidémiologie, génétique, 
                    éthique et déontologie), les étudiants choisissent 18 ECTS en fonction de leur projet personnel et professionnel, puis effectuent 
                    un stage de 2 mois avec rapport écrit. 
                    La seconde année (M2) propose 6 spécialités différentes listées ci-dessous, avec outre la valida");
            WriteLiteral(@"tion de crédits d’enseignement 
                    spécifiques, un stage de 6 mois d’initiation à la recherche.
                    <br/>Les parcours proposés sont les suivants :
                </p>
                <ul class=""one_list"">
                    <li> 
                        Méthodes en évaluation thérapeutique: biostatistique, épidémiologie clinique
                    </li>
                    <li> 
                        Management des organisations médicales et médico-sociales
                     </li>
                    <li> 
                        Santé internationale
                    </li>
                    <li> 
                        Promotion de la santé et développement social
                    </li>
                    <li> 
                        Sante, Travail, Environnement
                     </li>
                    <li> 
                        Recherche clinique en Addictologie
                    </li>
                </ul>

