                   Débouchés professionnels / Métiers :
                </p>
                <ul class=""one_list"">
                    <li> Chargé d'études statistiques dans les sociétés de services de l'industrie pharmaceutique, dans les organismes de recherche du secteur public, dans les organismes d'administration et de gestion de la santé </li>
                    <li> Responsable d'études cliniques </li>
                    <li> Responsable des études épidémiologiques </li>
                    <li> Chargé de projets en santé publique </li>
                    <li> Directeur de clinique </li>
                    <li> Data Manager dans le secteur sanitaire et médico-social </li>
                    <li> Cadre ou chef de projets au sein d'organismes non gouvernementaux, de programmes de recherche opérationnelle, d'une structure de recherch");
            WriteLiteral(@"e, d'un bureau d'étude travaillant en santé internationale </li>
                    <li> Médecins/pharmaciens/sages-femmes experts en santé internationale et en pathologies tropicales </li>
                    <li> Consultant ou Conseiller technique en santé publique auprès d'une agence des Nations Unies </li>
                    <li> Chargé d'études dans les secteurs de la prévention, de l'intervention sociale et de la programmation locale des actions de santé. </li>
                </ul>
